import spotifyApi from "./api";


const App = () => {
  const [isLoading, setLoading] = useState(false);
  const [categoryData, setCategoryData] = useState(null);



  useEffect(async () => {
    setLoading(true);
    const { data } = await spotifyApi.get("spotifyApi");
    setCategoryData(data);
    setLoading(false);
    console.log(data);
  }, []);



  return (
    <div>
      hello world
    </div>
  )
}

